import React from "react";

const Index = () => {
  return (
    <div>
      <div className="bg-gray-200">
        <h1>
          <img
            src="/logo.png"
            alt="mydailystatus"
            className="h-24 py-4 mx-auto"
          />
        </h1>

        <div className="bg-gray-500">NavBar</div>
      </div>
    </div>
  );
};

export default Index;
